import seriesData from "../../db/seriesData";

const SeriesList = () => {
  return (
    <ul>
      {seriesData.map(({ title }, index) => {
        return (
          <li key={index}>
            <h4>{title}</h4>
          </li>
        );
      })}
    </ul>
  );
};
export default SeriesList;
